const divStyle = {
  //paddingBottom: 100,
  position: 'relative',
}
const btnDivStyle = {
  position: 'absolute',
	top: '40%',
  left: '20%',
}


const Banner = props => (
  <div style={divStyle}>
    <img style={imgStyle} src="../static/banner.jpg" alt="Banner Image"/>
    <div style={btnDivStyle}>
      <button style={btnStyle1}>Amazon</button>
      <button style={btnStyle2}>Naver Shopping</button>
      <button style={btnStyle3}>Shopee</button>
    </div>
  </div>
);
